import * as React from 'react';
import { View, Text, Image } from 'react-native';
import { SafeAreaView } from 'react-native-web';
import { assets } from '../../constants';

export default function Akun({ navigation }) {
    return (
        <SafeAreaView style={{ flex:1 }}>
            <View style={{ flex:1 }}>
                <View style={{ position:"absolute",
                top: 0,
                bottom: 0,
                right:0,
                left:0,
                zIndex:-1, }}/>
                <View style={{ height:"70%", backgroundColor:"#143D71" }}/>
                <View style={{ height:"35%", backgroundColor:"#143D71" }}>
                    <Image source={assets.rect1} resizeMode="contain" style={{ width:"100%",height:"100%" }}/>
                </View>
            </View>
        </SafeAreaView>
    );
}
